import React from 'react';
import './Content.css';
import logo from '../assets/logo.png'; // Reuse same logo

const Content = () => {
  return (
    <section className="content-section">
      <div className="content-container">
        <img src={logo} alt="SLAM Fitness Studio" className="content-logo" />
        <h2>NEWPLANOTHESSSHOOD</h2>
        <h3>SLAM FITNESS STUDIO</h3>
        
        <div className="content-text">
          <p className="lead">SLAM Fitness is not a gym; it is a way of life.</p>
          
          <p>
            Slam Fitness Studio is a peer-to-friendinar for fitness enthusiasts who use all results-driven habits,
            appreciate the health and wellness. Coaching is in 2016. Slam Fitness used three third most healthy meals with
            its innovative programs, cutting-edge facilities, and focus on building a supportive fitness community.
          </p>
        </div>
      </div>
    </section>
  );
};

export default Content;
